class Details extends React.Component {

    constructor(props){
        super(props)
        this.state = {

        }

    }

    render() {
        return (
            <div className="main_content">
                <div className="navbar_line"/>
                <div className="flex details_name_icon_cont">
                    <div className="details_image_container">
                        <img className="center" src={pickture}/>
                    </div>
                    <div className="full_width_details">
                        <p className="details_name_title">Название</p>
                        <Input type="text" placeholder="Введите название подкаста"/>
